{'publishedAt': '2023-06-02T19:45:39Z', 'channelId': 'UC0fGGprihDIlQ3ykWvcb9hg', 'title': 'Veganismo Popular - Vitor Ávila', 'description': 'Está no ar no nosso canal uma participação super especial.

@veganovitor é há bastante tempo editor de vídeos aqui do Tese Onze. Ele próprio, ativista e comunicador cheio de conteúdo que recomendamos muitíssimo acompanharem.

Vitor não tem medo de "comprar a briga", com toda a sensibilidade que esbanja, seja com os liberais que buscam cooptar e hegemonizar o movimento vegano, quanto com a esquerda que levanta tantas barreiras para refletir sobre a importância da opressão especista no mundo. A síntese que supera esses problemas é o veganismo popular, que ele introduz muito bem nesse vídeo.

Tambem nesse vídeo, ele parte de contribuições da Angela Davis, enorme referência Comunista, anti opressões e vegana, para discutir como a liberdade não existe em meio à uma coletividade que oprime. Nossa liberdade só existe quando lutamos, constantemente, pela liberdade de todes.', 'thumbnails': {'default': {'url': 'https://i.ytimg.com/vi/8zeCYO68vb8/default.jpg', 'width': 120, 'height': 90}, 'medium': {'url': 'https://i.ytimg.com/vi/8zeCYO68vb8/mqdefault.jpg', 'width': 320, 'height': 180}, 'high': {'url': 'https://i.ytimg.com/vi/8zeCYO68vb8/hqdefault.jpg', 'width': 480, 'height': 360}, 'standard': {'url': 'https://i.ytimg.com/vi/8zeCYO68vb8/sddefault.jpg', 'width': 640, 'height': 480}, 'maxres': {'url': 'https://i.ytimg.com/vi/8zeCYO68vb8/maxresdefault.jpg', 'width': 1280, 'height': 720}}, 'channelTitle': 'Tese Onze', 'playlistId': 'UU0fGGprihDIlQ3ykWvcb9hg', 'position': 0, 'resourceId': {'kind': 'youtube#video', 'videoId': '8zeCYO68vb8'}, 'videoOwnerChannelTitle': 'Tese Onze', 'videoOwnerChannelId': 'UC0fGGprihDIlQ3ykWvcb9hg'}

